import React from 'react'

import '../../normalize.scss'
import '../../base.scss'

import SobreAsStars from '../../components/SobreStars/SobreStars';
import TermosStars from '../../components/SobreStars/CondicaoStars';
import Banner from '../../components/Header/Banner';
import View from "../view/view"

import imgBanner from '../../components/Header/Banner/destaques/CompresuasStars/1280.png'

function SobreStars() {
  let contentBanner = "Nec aliquam volutpat donec sit amet"
  return (
    <View public={true}>
      <Banner imagemBanner={imgBanner} text={contentBanner} />
      <SobreAsStars />
      <TermosStars />
    </View>
  )
}

export default SobreStars;
